webpackJsonp([0x6d12d121f022],{328:function(u,i){u.exports={data:{postsJson:{title:"Two Miraculous Births",questionsTitle:"COMPARISON, CONTRAST & REPETITION",display:"block",bookName:"lQk",ref:"1:1-2:40",html:"<p>   <strong>1</strong><u>1</u>sins menE hav undutAkun tQ set in UUdu u narutiv kunsuuniN DOz matuz wic hav bEn fqlfild umuN us, <u>2</u>Evun az DOz hQ frRm Du biginiN wuu Iwitnusiz und suuvunts Rv Du wuud dilivud Dem tQ us, <u>3</u>it sEmd gqd tQ mE UUlsO, haviN trAst Du kUUs Rv UUl TiNz akyqrutlE frRm Du fuust, tQ rIt tQ yQ in UUdu, mOst eksulunt TERfulis; <u>4</u>Dat yQ mIt nO Du suutuntE kunsuuniN Du TiNz in wic yQ wuu instruktid.<u>5</u>Deu wRz in Du dAz Rv herud, Du kiN Rv jQdEu, u suutun prEst nAmd zakurIus, Rv Du prEstlE diviJun Rv oobiju. hE had u wIf Rv Du dUUtuz Rv eurun, und huu nAm wRz ilizubuT. <u>6</u>DA wuu bOT rIcus bifUU gRd, wUUkiN blAmluslE in UUl Du kumoondmunts und UUdununsiz Rv Du lUUd. <u>7</u>but DA had nO cIld, bikRz ilizubuT wRz barun, und DA bOT wuu wel udvoonst in yiuz.<u>8</u>nW wIl hE eksukyQtid Du prEsts Rfis bifUU gRd in Du UUdu Rv hiz diviJun <u>9</u>ukUUdiN tQ Du kustum Rv Du prEsts Rfis, hiz lRt wRz tQ entu intQ Du tempul Rv Du lUUd und buun insens. <u>10</u>Du hOl multityQd Rv Du pEpul wuu prAiN WtsId at Du Wu Rv insens.<u>11</u>an Anjul Rv Du lUUd upiud tQ him, standiN Rn Du rIt sId Rv Du Rltu Rv insens. <u>12</u>zakurIus wRz trubuld wen hE sUU him, und fiu fel upRn him. <u>13</u>but Du Anjul sed tQ him,</p><h1>GABRIEL</h1><h4>dOnt bE ufrAd, zakurIus, bikRz yUU rikwest haz bEn huud. yUU wIf, ilizubuT, wil beu yQ u sun, und yQ Sal kUUl hiz nAm jRn. <u>14</u>yQ wil hav jY und gladnus, und menE wil rijYs at hiz buuT. <u>15</u>fUU hE wil bE grAt in Du sIt Rv Du lUUd, und hE wil driNk nO wIn nUU strRN driNk. hE wil bE fild wiD Du hOlE spirit, Evun frRm hiz muDuz wQm. <u>16</u>hE wil tuun menE Rv Du cildrun Rv izrAul tQ Du lUUd Deu gRd. <u>17</u>hE wil gO bifUU him in Du spirit und pWu Rv elIju, ‘tQ tuun Du hoots Rv Du fooDuz tQ Du cildrun,’ und Du disubEdEunt tQ Du wizdum Rv Du just; tQ prEpeu u pEpul prEpeud fUU Du lUUd.</h4><p><u>18</u>zakurIus sed tQ Du Anjul,</p><h1>ZECHARIAH THE PRIEST</h1><h4>hW kan I bE SUU Rv Dis? fUU I am an Old man, und mI wIf iz wel udvoonst in yiuz.</h4><p><u>19</u>Du Anjul oonsud him,</p><h1>GABRIEL</h1><h4>I am gAbrEul, hQ standz in Du prezuns Rv gRd. I wRz sent tQ spEk tQ yQ und tQ briN yQ Dis gqd nyQz. <u>20</u>bihOld, yQ wil bE sIlunt und nRt Abul tQ spEk until Du dA Dat DEz TiNz wil hapun, bikRz yQ didunt bilEv mI wuudz, wic wil bE fqlfild in Deu prRpu tIm.</h4><p><u>21</u>Du pEpul wuu wAtiN fUU zakurIus, und DA moovuld Dat hE dilAd in Du tempul. <u>22</u>wen hE kAm Wt, hE kqd nRt spEk tQ Dem. DA pusEvd Dat hE had sEn u viJun in Du tempul. hE kuntinyQd mAkiN sInz tQ Dem, und rimAnd myQt. <u>23</u>wen Du dAz Rv hiz suuvis wuu fqlfild, hE dipootid tQ hiz hWs. <u>24</u>ooftu DEz dAz ilizubuT hiz wIf kunsEvd, und SE hid huuself fIv munTs, sAiN, <u>25</u></p><h1>ELIZABETH</h1><h4>Dus haz Du lUUd dun tQ mE in Du dAz in wic hE lqkt at mE, tQ tAk uwA mI riprOc umuN men.</h4><p><u>26</u>nW in Du siksT munT, Du Anjul gAbrEul wRz sent frRm gRd tQ u sitE Rv galulE nAmd nazuruT, <u>27</u>tQ u vuujin plejd tQ bE marEd tQ u man hQz nAm wRz jOsif, Rv dAvidz hWs. Du vuujinz nAm wRz meurE. <u>28</u>haviN kum in, Du Anjul sed tQ huu,</p><h1>GABRIEL</h1><h4>rijYs, yQ hIlE fAvud wun! Du lUUd iz wiD yQ. blesid oo yQ umuN wimin!</h4><p><u>29</u>but wen SE sUU him, SE wRz grAtlE trubuld at Du sAiN, und kunsidud wRt kInd Rv salyqtASun Dis mIt bE. <u>30</u>Du Anjul sed tQ huu,</p><h1>GABRIEL</h1><h4>dOnt bE ufrAd, meurE, fUU yQ hav fWnd fAvu wiD gRd. <u>31</u>bihOld, yQ wil kunsEv in yUU wQm und giv buuT tQ u sun, und Sal nAm him ‘jEzus.’ <u>32</u>hE wil bE grAt und wil bE kUUld Du sun Rv Du mOst hI. Du lUUd gRd wil giv him Du TrOn Rv hiz fooDu dAvid, <u>33</u>und hE wil rAn Ovu Du hWs Rv jAkub furevu. Deu wil bE nO end tQ hiz kiNdum.</h4><p><u>34</u>meurE sed tQ Du Anjul,</p><h1>MARY MOTHER OF JESUS</h1><h4>hW kan Dis bE, sEiN I am u vuujin?</h4><p><u>35</u>Du Anjul oonsud huu,</p><h1>GABRIEL</h1><h4>Du hOlE spirit wil kum Rn yQ, und Du pWu Rv Du mOst hI wil OvuuSadO yQ. DeufUU UUlsO Du hOlE wun hQ iz bUUn frRm yQ wil bE kUUld Du sun Rv gRd. <u>36</u>bihOld, ilizubuT yUU relutiv UUlsO haz kunsEvd u sun in huu Old Aj; und Dis iz Du siksT munT wiD huu hQ wRz kUUld barun. <u>37</u>fUU nuTiN spOkun bI gRd iz impRsubul.</h4><p><u>38</u>meurE sed,</p><h1>MARY MOTHER OF JESUS</h1><h4>bihOld, Du suuvunt Rv Du lUUd; let it bE dun tQ mE ukUUdiN tQ yUU wuud.</h4><p>Den Du Anjul dipootid frRm huu.<u>39</u>meurE urOz in DOz dAz und went intQ Du hil kuntrE wiD hAst, intQ u sitE Rv jQdu, <u>40</u>und entud intQ Du hWs Rv zakurIus und grEtud ilizubuT. <u>41</u>wen ilizubuT huud meurEz grEtiN, Du bAbE lept in huu wQm; und ilizubuT wRz fild wiD Du hOlE spirit. <u>42</u>SE kUUld Wt wiD u lWd vYs und sed,</p><h1>ELIZABETH</h1><h4>blesid oo yQ umuN wimin, und blesid iz Du frQt Rv yUU wQm! <u>43</u>wI am I sO fAvud, Dat Du muDu Rv mI lUUd Sqd kum tQ mE? <u>44</u>fUU bihOld, wen Du vYs Rv yUU grEtiN kAm intQ mI iuz, Du bAbE lept in mI wQm fUU jY! <u>45</u>blesid iz SE hQ bilEvd, fUU Deu wil bE u fqlfilmunt Rv Du TiNz wic hav bEn spOkun tQ huu frRm Du lUUd!</h4><p><u>46</u>meurE sed,</p><h1>MARY MOTHER OF JESUS</h1><h4>mI sOl magnifIz Du lUUd.<u>47</u>mI spirit haz rijYst in gRd mI sAvyu,<u>48</u>fUU hE haz lqkt at Du humbul stAt Rv hiz suuvunt.fUU bihOld, frRm nW Rn, UUl jenurASunz wil kUUl mE blest.<u>49</u>fUU hE hQ iz mItE haz dun grAt TiNz fUU mE.hOlE iz hiz nAm.<u>50</u>hiz muusE iz fUU jenurASunz und jenurASunz Rn DOz hQ fiu him.<u>51</u>hE haz SOn streNkT wiD hiz oom.hE haz skatud Du prWd in Du imajunASun Rv Deu hoots.<u>52</u>hE haz pqt dWn prinsiz frRm Deu TrOns,und haz igzUUltid Du lOlE.<u>53</u>hE haz fild Du huNgrE wiD gqd TiNz.hE haz sent Du ric uwA emptE.<u>54</u>hE haz givun help tQ izrAul, hiz suuvunt, Dat hE mIt rimembu muusE,<u>55</u>az hE spOk tQ Wu fooDuz,tQ Abruham und hiz RfspriN furevu.</h4><p><u>56</u>meurE stAd wiD huu ubWt TrE munTs, und Den rituund tQ huu hWs.<u>57</u>nW Du tIm Dat ilizubuT Sqd giv buuT wRz fqlfild, und SE gAv buuT tQ u sun. <u>58</u>huu nAbuz und huu relutivz huud Dat Du lUUd had magnifId hiz muusE tuwUUd huu, und DA rijYst wiD huu. <u>59</u>Rn Du AtT dA, DA kAm tQ suukumsIz Du cIld; und DA wqd hav kUUld him zakurIus, ooftu Du nAm Rv hiz fooDu. <u>60</u>hiz muDu oonsud,</p><h1>ELIZABETH</h1><h4>nRt sO; but hE wil bE kUUld jRn.</h4><p><u>61</u>DA sed tQ huu,</p><h1>ELIZABETH’S NEIGHBORS</h1><h4>Deu iz nO wun umuN yUU relutivz hQ iz kUUld bI Dis nAm.</h4><p> <u>62</u>DA mAd sInz tQ hiz fooDu, wRt hE wqd hav him kUUld.<u>63</u>hE askt fUU u rItiN tablut, und rOt, “hiz nAm iz jRn.”DA UUl moovuld. <u>64</u>hiz mWT wRz Opund imEdEutlE und hiz tuN frEd, und hE spOk, blesiN gRd. <u>65</u>fiu kAm Rn UUl hQ livd urWnd Dem, und UUl DEz sAiNz wuu tUUkt ubWt TrQWt UUl Du hil kuntrE Rv jQdEu. <u>66</u>UUl hQ huud Dem lAd Dem up in Deu hoot, sAiN,</p><h1>PEOPLE IN JUDEA</h1><h4>wRt Den wil Dis cIld bE?</h4><p> Du hand Rv Du lUUd wRz wiD him.<u>67</u>hiz fooDu zakurIus wRz fild wiD Du hOlE spirit, und prRfisId, sAiN,<u>68</u></p><h1>ZECHARIAH THE PRIEST</h1><h4>blesid bE Du lUUd, Du gRd Rv izrAul,fUU hE haz vizitid und ridEmd hiz pEpul;<u>69</u>und haz rAzd up u hUUn Rv salvASun fUU us in Du hWs Rv hiz suuvunt dAvid<u>70</u>(az hE spOk bI Du mWT Rv hiz hOlE prRfits hQ hav bEn frRm Rv Old),<u>71</u>salvASun frRm Wu enumEz und frRm Du hand Rv UUl hQ hAt us;<u>72</u>tQ SO muusE tuwUUd Wu fooDuz,tQ rimembu hiz hOlE kuvununt,<u>73</u>Du OT wic hE swUU tQ Abruham Wu fooDu,<u>74</u>tQ groont tQ us Dat wE, bEiN dilivud Wt Rv Du hand Rv Wu enumEz,Sqd suuv him wiTWt fiu,<u>75</u>in hOlEnus und rIcusnus bifUU him UUl Du dAz Rv Wu lIf.<u>76</u>und yQ, cIld, wil bE kUUld u prRfit Rv Du mOst hI;fUU yQ wil gO bifUU Du fAs Rv Du lUUd tQ prEpeu hiz wAz,<u>77</u>tQ giv nRlij Rv salvASun tQ hiz pEpul bI Du rEmiSun Rv Deu sinz,<u>78</u>bikRz Rv Du tendu muusE Rv Wu gRd,bI wic Du dUUn frRm Rn hI wil vizit us,<u>79</u>tQ SIn Rn DOz hQ sit in dooknus und Du SadO Rv deT;tQ gId Wu fEt intQ Du wA Rv pEs.</h4><p><u>80</u>Du cIld wRz grOiN und bikumiN strRN in spirit, und wRz in Du dezuut until Du dA Rv hiz publik upiuruns tQ izrAul.<strong>2</strong><u>1</u>nW in DOz dAz, u dikrE went Wt frRm sEzu Rgustus Dat UUl Du wuuld Sqd bE enrOld. <u>2</u>Dis wRz Du fuust enrOlmunt mAd wen kwiurinEus wRz guvunu Rv sirEu. <u>3</u>UUl went tQ enrOl Demselvz, evrEwun tQ hiz On sitE. <u>4</u>jOsif UUlsO went up frRm galulE, Wt Rv Du sitE Rv nazuruT, intQ jQdEu, tQ dAvidz sitE, wic iz kUUld beTlihem, bikRz hE wRz Rv Du hWs und famulE Rv dAvid; <u>5</u>tQ enrOl himself wiD meurE, hQ wRz plejd tQ bE marEd tQ him az wIf, bEiN pregnunt.<u>6</u>wIl DA wuu Deu, Du dA had kum fUU huu tQ giv buuT. <u>7</u>SE gAv buuT tQ huu fuustbUUn sun. SE rapt him in bandz Rv klRT, und lAd him in u fEdiN trRf, bikRz Deu wRz nO rQm fUU Dem in Du in. <u>8</u>Deu wuu Sepudz in Du sAm kuntrE stAiN in Du fEld, und kEpiN wRc bI nIt Ovu Deu flRk. <u>9</u>bihOld, an Anjul Rv Du lUUd stqd bI Dem, und Du glUUE Rv Du lUUd SOn urWnd Dem, und DA wuu terufId. <u>10</u>Du Anjul sed tQ Dem,</p><h1>AN ANGEL</h1><h4>dOnt bE ufrAd, fUU bihOld, I briN yQ gqd nyQz Rv grAt jY wic wil bE tQ UUl Du pEpul. <u>11</u>fUU Deu iz bUUn tQ yQ tudA, in dAvidz sitE, u sAvyu, hQ iz krIst Du lUUd. <u>12</u>Dis iz Du sIn tQ yQ: yQ wil fInd u bAbE rapt in strips Rv klRT, lIiN in u fEdiN trRf.</h4><p> <u>13</u>sudunlE, Deu wRz wiD Du Anjul u multityQd Rv Du hevunlE oomE prAziN gRd, und sAiN,<u>14</u></p><h1>A HOST OF ANGELS</h1><h4>glUUE tQ gRd in Du hIust,Rn uuT pEs, gqd wil tuwUUd men.</h4><p><u>15</u>wen Du Anjulz went uwA frRm Dem intQ Du skI, Du Sepudz sed tQ wun unuDu,</p><h1>SHEPHERDS NEAR BETHLEHEM</h1><h4>lets gO tQ beTlihem, nW, und sE Dis TiN Dat haz hapund, wic Du lUUd haz mAd nOn tQ us.</h4><p> <u>16</u>DA kAm wiD hAst, und fWnd bOT meurE und jOsif, und Du bAbE wRz lIiN in Du fEdiN trRf. <u>17</u>wen DA sUU it, DA publisIzd wIdlE Du sAiN wic wRz spOkun tQ Dem ubWt Dis cIld. <u>18</u>UUl hQ huud it wundud at Du TiNz wic wuu spOkun tQ Dem bI Du Sepudz. <u>19</u>but meurE kept UUl DEz sAiNz, pRnduuiN Dem in huu hoot. <u>20</u>Du Sepudz rituund, glUUufIiN und prAziN gRd fUU UUl Du TiNz Dat DA had huud und sEn, just az it wRz tOld Dem.<u>21</u>wen At dAz wuu fqlfild fUU Du suukumsiJun Rv Du cIld, hiz nAm wRz kUUld jEzus, wic wRz givun bI Du Anjul bifUU hE wRz kunsEvd in Du wQm.<u>22</u>wen Du dAz Rv Deu pyqurifikASun ukUUdiN tQ Du lR Rv mOzus wuu fqlfild, DA brRt him up tQ juuQsulum, tQ {{prezunt, prEzent, puzent}} him tQ Du lUUd <u>23</u>(az it iz ritun in Du lR Rv Du lUUd, “evrE mAl hQ Opunz Du wQm Sal bE kUUld hOlE tQ Du lUUd”), <u>24</u>und tQ Rfu u sakrufIs ukUUdiN tQ Dat wic iz sed in Du lR Rv Du lUUd, “u peu Rv tuutulduvz, UU tQ yuN pijunz.”<u>25</u>bihOld, Deu wRz u man in juuQsulum hQz nAm wRz simEun. Dis man wRz rIcus und divWt, lqkiN fUU Du kRnsulASun Rv izrAul, und Du hOlE spirit wRz Rn him. <u>26</u>it had bEn rivEld tQ him bI Du hOlE spirit Dat hE Sqd nRt sE deT bifUU hE had sEn Du lUUdz krIst. <u>27</u>hE kAm in Du spirit intQ Du tempul. wen Du peurunts brRt in Du cIld, jEzus, Dat DA mIt dQ kunsuuniN him ukUUdiN tQ Du kustum Rv Du lR, <u>28</u>Den hE rusEvd him intQ hiz oomz, und blesid gRd, und sed,<u>29</u></p><h1>SIMEON</h1><h4>nW yQ oo rElEsiN yUU suuvunt, moostu,ukUUdiN tQ yUU wuud, in pEs;   <u>30</u>fUU mI Iz hav sEn yUU salvASun,<u>31</u>wic yQ hav prEpeud bifUU Du fAs Rv UUl pEpulz;<u>32</u>u lIt fUU revulASun tQ Du nASunz,und Du glUUE Rv yUU pEpul izrAul.</h4><p><u>33</u>jOsif und hiz muDu wuu moovuliN at Du TiNz wic wuu spOkun kunsuuniN him, <u>34</u>und simEun blesid Dem, und sed tQ meurE, hiz muDu,</p><h1>SIMEON</h1><h4>bihOld, Dis cIld iz set fUU Du fRliN und Du rIziN Rv menE in izrAul, und fUU u sIn wic iz spOkun ugenst. <u>35</u>yes, u sUUd wil pius TrQ yUU On sOl, Dat Du TRts Rv menE hoots mA bE rivEld.</h4><p><u>36</u>Deu wRz wun anu, u prRfitus, Du dUUtu Rv fanyQul, Rv Du trIb Rv aSu (SE wRz Rv u grAt Aj, haviN livd wiD u huzbund sevun yiuz frRm huu vuujinitE, <u>37</u>und SE had bEn u widO fUU ubWt AtE-fUU yiuz), hQ didunt dipoot frRm Du tempul, wuuSipiN wiD foostiNs und putiSunz nIt und dA. <u>38</u>kumiN up at Dat verE Wu, SE gAv TaNks tQ Du lUUd, und spOk Rv him tQ UUl DOz hQ wuu lqkiN fUU ridempSun in juuQsulum.<u>39</u>wen DA had ukRmpliSt UUl TiNz Dat wuu ukUUdiN tQ Du lR Rv Du lUUd, DA rituund intQ galulE, tQ Deu On sitE, nazuruT. <u>40</u>Du cIld wRz grOiN, und wRz bikumiN strRN in spirit, bEiN fild wiD wizdum, und Du grAs Rv gRd wRz upRn him.</p>",path:"/326",Question1:"To compare is to associate two or more similar persons, ideas, or situations. Can you discover any comparisons made by the author of this story? Why do you think that the author would have made this comparison?",Question2:"To contrast is to put side by side two or more distinct persons, ideas, or situations. Can you discover any contrasts made by the author of this story? Why do you think that the author would have made this contrast?",Question3:"Take time to note any repeated words or concepts you have found in this story.",Question4:"Please take time to write a short prayer to God responding to what you have discovered through these comparisons, contrasts and repetitions.",prevPath:"/",nextPath:"/327"}},pathContext:{}}}});
